const initialSpriteState = {
  sprites: []
};


export default function spriteReducer(state = initialSpriteState, action) {
  console.log('%c userReducer', 'color: orange', action);

  switch(action.type) {
    case 'CHANGE_SPRITE':
      return "test"
    default:
      return state;
  }
}
